import React, { useState, useEffect } from "react";
import axios from "axios";
import "./widgetLg.css"

const urlEvento = "https://back-calistenia.herokuapp.com/api/evento/ultimo";

export default function WidgetLg() {
    //programar visualizar ultimos eventos, fecha
    //ultimas noticias
    //total de ejercicios
    //total rutinas
    //total parques
    const [evento, setEvento] = useState([]);

    useEffect(() => {
        const ultimoEvento = async () => {
            await axios
            .get(urlEvento)
            .then((response) => {
                setEvento(response.data);
            })
            .catch((error) => {
            console.log(error);
            });
        };
        ultimoEvento()
      }, []);

    return (
        <div className="widgetLg">
            <h3 className="widgetLgTitle">Proximos Eventos</h3>
            <table className="widgetLgTable">
                <tr className="widgetLgTr">
                    <th className="widgetLgTh">{evento.nombre}</th>
                    <th className="widgetLgTh">{evento.descripcion}</th>
                    <th className="widgetLgTh">{evento.fecha}</th>
                </tr>
            </table>
        </div>
    )
}
